import React from 'react' ;

function LoginForm() {
  return (
    <div id="loginform">
      <FormHeader title="Login" />
      <Form />
      <OtherMethods />
    </div>
  );
}

function FormHeader(props) {
  return <h2 id="headerTitle">{props.title}</h2>;
}

function Form(props) {
  return (
    <div>
      <FormInput description="Username" placeholder="Enter your username" type="text" />
      <FormInput description="Password" placeholder="Enter your password" type="password"/>
      <FormButton title="Log in"/>
    </div>
  );
}

function FormButton(props) {
  return (
    <div id="button" class="row">
      <button>{props.title}</button>
    </div>
  );
}

function FormInput(props) {
  return (
    <div class="row">
      <label>{props.description}</label>
      <input type={props.type} placeholder={props.placeholder}/>
    </div>  
  );
}

function OtherMethods(props) {
  return (
    <div id="alternativeLogin">
      <label>Or sign in with:</label>
      <div id="iconGroup">
        <Facebook />
        <Twitter />
        <Google />
      </div>
    </div>
  );
}

function Facebook(props) {
  return <a href="#" id="facebookIcon"></a>;
}

function Twitter(props) {
  return <a href="#" id="twitterIcon"></a>;
}

function Google(props) {
  return <a href="#" id="googleIcon"></a>;
}

ReactDOM.render(<LoginForm />, document.getElementById('container'));

export default LoginForm ;
